import React, { Component } from 'react'
import styled from 'styled-components'

const WeatherLogo = styled.img`
width: 140px;
height: 140px;
`;


export default class CityComponent extends Component {
  render() {
    return (
      <>
        <WeatherLogo src="/icon/perfect-day.svg"/>
      </>
    )
  }
}
